-- 테이블 NHLINE.TB_AGENT_LINE 구조 내보내기
CREATE TABLE IF NOT EXISTS `TB_AGENT_LINE` (
  `MNG_NO` varchar(10) NOT NULL COMMENT '회선관리번호(자체생성관리키값)',
  `LINE_NO` varchar(20) DEFAULT NULL COMMENT '회선번호(KT,LG)-UNIQUE INDEX',
  `LINE_NAME` varchar(100) DEFAULT NULL COMMENT '회선명(영업점명 + 추가되는 명칭)',
  `CENTER_ID` varchar(5) DEFAULT NULL COMMENT '지역센터코드(TB_CM_CENTER)',
  `AGENT_CODE` varchar(10) DEFAULT NULL COMMENT '영업점코드',
  `ISP_CODE` varchar(10) DEFAULT NULL COMMENT '통신사업자(TB_BASIC_CODE : ISPCD)',
  `LINE_GB` varchar(30) DEFAULT NULL COMMENT '전용선종류(KT), 구분(LG)',
  `BAND_GB` char(1) DEFAULT 'O' COMMENT 'IP대역 구분(O:구IP대역,N:신IP대역)',
  `LINE_SPEED` varchar(10) DEFAULT NULL COMMENT '회선속도(TB_BASIC_CODE : SPEED)',
  `ZONE_GB` varchar(10) DEFAULT NULL COMMENT '시내/시외구분 (시내,시외)',
  `UP_GUK` varchar(50) DEFAULT NULL COMMENT '상위국',
  `DOWN_GUK` varchar(50) DEFAULT NULL COMMENT '하위국',
  `UP_CENTER` varchar(50) DEFAULT NULL COMMENT '상위국 광역센터명(LG)',
  `DOWN_CENTER` varchar(50) DEFAULT NULL COMMENT '하위국 광역센터명(LG)',
  `BILL_SPACE` varchar(20) DEFAULT NULL COMMENT '과금거리',
  `LINE_TYPE` varchar(20) DEFAULT NULL COMMENT '선식(KT)',
  `SETUP_DATE` varchar(8) DEFAULT NULL COMMENT '설치일자',
  `CLOSE_DATE` varchar(8) DEFAULT NULL COMMENT '해지일자',
  `LINE_ADDR` varchar(200) DEFAULT NULL COMMENT '회선설치주소(지역)',
  `BIGO` varchar(200) DEFAULT NULL COMMENT '비고(기타설명)',
  `LINE_FLAG` varchar(10) DEFAULT NULL COMMENT '회선종류(TB_BASIC_CODE : LTYPE)',
  `SALES_TYPE` varchar(10) DEFAULT NULL COMMENT '영업형태 구분(TB_BASIC_CODE : ATYPE)',
  `IP_ADDR` varchar(50) DEFAULT NULL COMMENT 'IP주소',
  `SERIAL_IP1` varchar(50) DEFAULT NULL COMMENT '시리얼IP1',
  `SERIAL_IP2` varchar(50) DEFAULT NULL COMMENT '시리얼IP2',
  `USE_GB` char(1) DEFAULT 'U' COMMENT '회선사용구분(N:신규등록,U:사용중,S:일시정지,T:해지,M:관리점이동)',
  `JOB_GB` varchar(10) DEFAULT NULL COMMENT '회선상태(TB_BASIC_CODE : JOBGB)',
  `COMP_YN` char(1) DEFAULT 'N' COMMENT '작업구분에 따른 완료구분(Y:완료,N:작업중)',
  `MODEM_RENT_YN` char(1) DEFAULT 'N' COMMENT '모뎀임대구분 (Y:임대, N:미임대)',
  `MNG_TM_FR` int DEFAULT NULL COMMENT '관리시간 From',
  `MNG_TM_TO` int DEFAULT NULL COMMENT '관리시간 To',
  `MNG_HOLIDAY` int DEFAULT NULL COMMENT '휴일관리',
  `AGENT_MAINT_NAME` varchar(20) DEFAULT NULL COMMENT '영업점관리자이름',
  `AGENT_MAINT_TEL` varchar(20) DEFAULT NULL COMMENT '영업점관리자연락처',
  `MOVE_DATE` varchar(8) DEFAULT NULL COMMENT '관리점이동일자',
  `OLD_LINE_NO` varchar(20) DEFAULT NULL COMMENT '고도화 이전 회선번호',
  `DEPT_CODE` varchar(10) DEFAULT NULL COMMENT '이용사무소',
  `CR_USER` varchar(20) DEFAULT NULL COMMENT '최초등록자ID',
  `CR_DT` varchar(14) DEFAULT NULL COMMENT '최초등록일시',
  `UP_USER` varchar(20) DEFAULT NULL COMMENT '최종수정자ID',
  `UP_DT` varchar(14) DEFAULT NULL COMMENT '최종수정일시',
  PRIMARY KEY (`MNG_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='영업점전용회선정보';

